import { LOAD_COMPLAINTS, LOAD_REVIEWS } from './types';
const initialState = {
    reviews: [],
    complaints: []
}

export const postsReducer = (state = initialState, action) => {
    switch(action.type){
        case LOAD_REVIEWS:
            return {
                ...state
            };
        case LOAD_COMPLAINTS:
            return {
                ...state
            };
        default:
            return state;
    }
}
